Now, we will commence our journey in writing Amethyst applications with the obligatory "Hello, World" program! In your crate's "main.rs" file, type out or copy and paste the following code: extern crate amethyst; use amethyst::prelude::*; struct HelloWorld; impl State for HelloWorld { fn on_start(&mut self, _: &mut Engine) { println!("Game started!"); } fn update(&mut self, _: &mut Engine) -> Trans { println!("Hello from Amethyst!"); Trans::Quit } fn on_stop(&mut self, _: &mut Engine) { println!("Game stopped!"); }
} fn main() { let cfg = Config::default(); let mut game = Application::build(HelloWorld, cfg).finish().expect("Fatal"); game.run();
} Then, compile and run the code with cargo run , or amethyst run if you have the CLI tool installed . You should see the following output print to your terminal: Game started!
Hello from Amethyst!
Game stopped! If instead you see error: use of unstable library feature then make sure you're using the nightly release of Rust. You can use rustup to install stable and nightly Rust side-by-side. Congratulations! You have successfully written your first Amethyst application.
